import React from 'react';
import './App.css';

export default class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          value: "Not Clicked",
          data: "NA"
        };
        this.pyth = this.pyth.bind(this)
    }

    pyth(vars = {}) {
      fetch("/api", {method: 'POST', headers: {'Content-Type': 'application/json'}, body: JSON.stringify(vars)})
        .then(res => res.json())
        .then(data => this.setState({data: data.message}));
    }

    render() {
        return <div className="App">
            <div className="Test">
                <button onClick={this.pyth({weather: 10})}>Mint</button>
                <div className="Test">
                    <span>{this.state.data}</span>
                </div>
            </div>
        </div>;
    };
};
